# == [PREP] == minimal deps, CUDA flags
def colab_prep_install(minimal=True):
    import subprocess, sys
    pkgs = ["rich", "tqdm", "pyyaml"]
    # pandas not required by runner, but CSVs remain pandas-friendly
    if not minimal:
        pkgs.append("pandas")
    try:
        subprocess.run([sys.executable, "-m", "pip", "install", "-q"] + pkgs, check=True)
    except Exception as e:
        print("[prep] warn: pip minimal deps failed:", e)

    # Torch comes with Colab; do not install here
    os.environ.setdefault("TORCHDYNAMO_CAPTURE_SCALAR_OUTPUTS", "1")

    try:
        import torch
        torch.set_float32_matmul_precision("medium")
        try:
            torch.backends.cudnn.benchmark = True
        except Exception:
            pass
    except Exception:
        pass


# == [EXTRACT] == decode zip to /content/emma/emma_starter_v0_1 and set PYTHONPATH
def extract_repo(outdir: Path) -> Path:
    target_root = outdir
    repo_root = target_root / "emma_starter_v0_1"
    target_root.mkdir(parents=True, exist_ok=True)
    (target_root / "results").mkdir(parents=True, exist_ok=True)
    (target_root / "runs").mkdir(parents=True, exist_ok=True)
    # extract
    zbytes = base64.b64decode(EMBED_ZIP_B64.encode("ascii"))
    with zipfile.ZipFile(io.BytesIO(zbytes), "r") as zf:
        zf.extractall(repo_root)
    # path setup
    pypath = os.environ.get("PYTHONPATH", "")
    add_paths = [str(target_root), str(repo_root)]
    for p in add_paths:
        if p not in pypath:
            pypath = f"{p}:{pypath}" if pypath else p
    os.environ["PYTHONPATH"] = pypath
    if str(target_root) not in sys.path:
        sys.path.insert(0, str(target_root))
    if str(repo_root) not in sys.path:
        sys.path.insert(0, str(repo_root))
    return repo_root


# == [UTILS] ==
def gpu_info():
    try:
        import torch
        if not torch.cuda.is_available():
            return None
        name = torch.cuda.get_device_name(0)
        try:
            free, total = torch.cuda.mem_get_info(0)
        except Exception:
            total = torch.cuda.get_device_properties(0).total_memory
            free = None
        return dict(name=name, total_mb=(total//(1024*1024)), free_mb=(None if free is None else free//(1024*1024)))
    except Exception:
        return None


def require_gpu_or_fail(mode: str):
    import torch
    if not torch.cuda.is_available():
        print(f"[fatal] No CUDA GPU detected for mode={mode}. In Colab: Runtime -> Change runtime type -> GPU.")
        sys.exit(1)


def parse_csv_list(s: str, typ):
    if s is None or s == "":
        return []
    return [typ(x.strip()) for x in s.split(',') if x.strip() != ""]


def write_csv_append(path: Path, header: list[str], row: dict):
    path.parent.mkdir(parents=True, exist_ok=True)
    write_header = (not path.exists()) or (path.stat().st_size == 0)
    with path.open("a", newline='') as f:
        w = csv.DictWriter(f, fieldnames=header)
        if write_header:
            w.writeheader()
        w.writerow({k: row.get(k, "") for k in header})


GPU_LOCK = threading.Lock()  # serialize GPU forwards, keep CPU precompute in parallel


# == [PROBES] == oracle scaling + deq convergence
def run_probes(args, outdir: Path):
    require_gpu_or_fail("probes")
    import torch
    from emma.data import make_dataloaders
    from emma.model import EMMA

    # model dims (lightweight but realistic)
    emb_dim = 48; hid_dim = 64; mem_dim = 256
    n_slots = 256; k_top = 16
    num_values = 64; vocab_extra = 96
    batch = args.batch

    def build_emma(vocab_size, deq_max_iter=8, mem_into_deq=False, mem_scale=1.0, oracle_write=True):
        m = EMMA(vocab_size=vocab_size,
                 emb_dim=emb_dim, hid_dim=hid_dim, mem_dim=mem_dim,
                 num_values=num_values,
                 n_slots=n_slots, k_top=k_top,
                 deq_max_iter=deq_max_iter, mem_into_deq=mem_into_deq,
                 mem_scale=mem_scale,
                 oracle_write=oracle_write)
        return m.eval()

    def one_batch(L, npairs):
        train_loader, _ = make_dataloaders(
            batch_size=batch, num_values=num_values, vocab_extra=vocab_extra,
            length=L, train_size=batch, val_size=batch, num_workers=2,
            n_pairs=npairs, decouple_kv=True)
        return next(iter(train_loader))

    results_dir = outdir / "results"
    oracle_csv = results_dir / "oracle_scaling.csv"
    deq_csv = results_dir / "deq_convergence.csv"
    combo_csv = results_dir / "combined_probe_results.csv"

    # probe grids
    lengths = parse_csv_list(args.lengths, int) if isinstance(args.lengths, str) else (args.lengths or [256,512,1024,2048])
    n_pairs = parse_csv_list(args.n_pairs, int) if isinstance(args.n_pairs, str) else (args.n_pairs or [1,2,4])
    deq_iters = parse_csv_list(args.deq_iters, int) if isinstance(args.deq_iters, str) else (args.deq_iters or [4,6,8,10,12])
    mem_scales = parse_csv_list(args.mem_scales, float) if isinstance(args.mem_scales, str) else (args.mem_scales or [0.3,0.5,0.7,1.0])

    # Helper: ensure header exists without emitting an empty row
    def ensure_csv_header(path, header):
        if not path.exists() or path.stat().st_size == 0:
            path.parent.mkdir(parents=True, exist_ok=True)
            import csv as _csv
            with path.open('w', newline='') as f:
                w = _csv.DictWriter(f, fieldnames=header)
                w.writeheader()

    # Oracle scaling tasks
    oracle_header = ["probe","length","n_pairs","batch","replicas","duration_sec","avg_fp_iters","acc","throughput_seqs_per_s"]
    deq_header    = ["probe","length","deq_iters","mem_scale","batch","duration_sec","avg_fp_iters","acc"]
    # Pre-create CSVs with headers to avoid combine failure on early errors
    ensure_csv_header(oracle_csv, oracle_header)
    ensure_csv_header(deq_csv, deq_header)

    device = torch.device("cuda")
    # Mixed precision can cause dtype mismatches in indexed writes; disable AMP for probes
    class _NoAmp:
        def __enter__(self): return None
        def __exit__(self, *a): return False
    amp = _NoAmp

    def run_oracle(L, npairs):
        b = one_batch(L, npairs)
        vocab_size = b['vocab_size']
        toks, key_id, wpos, qpos, tgt = b['tokens'], b['key_id'], b['write_pos'], b['query_pos'], b['target']
        t0 = time.perf_counter()
        with GPU_LOCK:
            m = build_emma(vocab_size, deq_max_iter=max(deq_iters), mem_into_deq=False, oracle_write=True).to(device)
            # warm-up one forward (JIT/compile, kernels) before timing
            torch.cuda.synchronize()
            with torch.no_grad():
                _ = m(toks.to(device), key_id.to(device), wpos.to(device), qpos.to(device), value_ids=tgt.to(device))
            torch.cuda.synchronize()
            t0 = time.perf_counter()
            with torch.no_grad():
                logits, metrics = m(toks.to(device), key_id.to(device), wpos.to(device), qpos.to(device), value_ids=tgt.to(device))
            torch.cuda.synchronize()
        dt = time.perf_counter() - t0
        acc = float((logits.argmax(-1) == tgt.to(device)).float().mean().item())
        avg_fp = float(metrics.get('avg_fp_iters', float('nan'))) if isinstance(metrics, dict) else float('nan')
        tps = toks.size(0)/dt if dt>0 else float('nan')
        row = dict(probe='oracle', length=L, n_pairs=npairs, batch=batch, replicas=1,
                   duration_sec=f"{dt:.6f}", avg_fp_iters=(f"{avg_fp:.3f}" if avg_fp==avg_fp else "nan"), acc=f"{acc:.6f}",
                   throughput_seqs_per_s=f"{tps:.3f}" if tps==tps else "nan")
        write_csv_append(oracle_csv, oracle_header, row)

    def run_deq(L, iters, ms):
        b = one_batch(L, max(n_pairs))
        vocab_size = b['vocab_size']
        toks, key_id, wpos, qpos, tgt = b['tokens'], b['key_id'], b['write_pos'], b['query_pos'], b['target']
        t0 = time.perf_counter()
        with GPU_LOCK:
            m = build_emma(vocab_size, deq_max_iter=iters, mem_into_deq=True, mem_scale=ms, oracle_write=True).to(device)
            # warm-up one forward before timing
            torch.cuda.synchronize()
            with torch.no_grad():
                _ = m(toks.to(device), key_id.to(device), wpos.to(device), qpos.to(device), value_ids=tgt.to(device))
            torch.cuda.synchronize()
            t0 = time.perf_counter()
            with torch.no_grad():
                logits, metrics = m(toks.to(device), key_id.to(device), wpos.to(device), qpos.to(device), value_ids=tgt.to(device))
            torch.cuda.synchronize()
        dt = time.perf_counter() - t0
        acc = float((logits.argmax(-1) == tgt.to(device)).float().mean().item())
        avg_fp = float(metrics.get('avg_fp_iters', float('nan'))) if isinstance(metrics, dict) else float('nan')
        row = dict(probe='deq', length=L, deq_iters=iters, mem_scale=ms, batch=batch,
                   duration_sec=f"{dt:.6f}", avg_fp_iters=(f"{avg_fp:.3f}" if avg_fp==avg_fp else "nan"), acc=f"{acc:.6f}")
        write_csv_append(deq_csv, deq_header, row)

    # launch in thread pool (GPU serialized)
    max_workers = min(8, max(1, int(args.max_concurrent or 1)))
    with ThreadPoolExecutor(max_workers=max_workers) as ex:
        futs = []
        for L in lengths:
            for np in n_pairs:
                futs.append(ex.submit(run_oracle, L, np))
        for L in lengths:
            for it in deq_iters:
                for ms in mem_scales:
                    futs.append(ex.submit(run_deq, L, it, ms))
        for f in as_completed(futs):
            try:
                f.result()
            except Exception as e:
                print("[probe] worker failed:", e)

    # combine
    try:
        with oracle_csv.open('r') as fo, deq_csv.open('r') as fd, combo_csv.open('w', newline='') as fc:
            ro = list(csv.DictReader(fo)); rd = list(csv.DictReader(fd))
            cols = sorted(set().union(*(r.keys() for r in (ro+rd))))
            w = csv.DictWriter(fc, fieldnames=cols); w.writeheader()
            for r in ro+rd:
                w.writerow(r)
        print("[probes] wrote:", oracle_csv, deq_csv, combo_csv)
    except Exception as e:
        print("[probes] combine failed:", e)


# == [TRAIN] == single + grid sweeps
def run_train(args, outdir: Path):
    require_gpu_or_fail("train")
    results_csv = outdir / "results" / "experiment_log.csv"
    runs_dir = outdir / "runs"
    cfg_dir = runs_dir / "configs"
    cfg_dir.mkdir(parents=True, exist_ok=True)

    gpu = gpu_info()
    if gpu:
        print(f"[gpu] {gpu['name']} total={gpu['total_mb']}MB free={gpu.get('free_mb','?')}MB")

    # defaults per prompt
    base = dict(
        seed=int(args.seed or 0),
        data=dict(decouple_kv=True, num_values=64, vocab_extra=96,
                  length=512, n_pairs=2,
                  train_size=(int(args.train_size) if args.train_size is not None else 8000),
                  val_size=(int(args.val_size) if args.val_size is not None else 800)),
        model=dict(emb_dim=64, hid_dim=128, mem_dim=1024),
        memory=dict(n_slots=1024, k_top=32),
        train=dict(batch_size=int(args.bsz or 32), lr=float(args.lr or 3e-3), wd=float(args.wd or 0.01),
                   epochs=int(args.epochs or 4), lr_after_warm_factor=0.5, num_workers=int(args.num_workers or 0)),
        emma=dict(deq_max_iter=int(args.deq or 8), oracle_write=False, warm_start_epochs=int(args.warm_start or 2),
                  oracle_mix_ramp_epochs=3, oracle_mix_min=float(args.mix_min or 0.3),
                  mem_into_deq=bool(int(args.mem_into_deq)) if args.mem_into_deq is not None else False,
                  mem_scale=float(args.mem_scale or 0.5), mem_scale_min=0.0, logit_scale_max=5.0, nce_gate_write_cos=0.15),
        loss=dict(lambda_pred_ce=float(args.lam_pred or 0.3), lambda_write_cos=float(args.lam_write or 0.2),
                  lambda_write_nce=float(args.lam_nce or 0.3))
    )

    # preset → grid
    preset = (args.preset or 'long512').lower()
    grids = []
    if preset == 'long256':
        for L in [256]: grids.append(dict(length=L, n_pairs=2))
    elif preset == 'long512':
        for L in [512]: grids.append(dict(length=L, n_pairs=2))
    elif preset == 'long1024':
        for L in [1024]: grids.append(dict(length=L, n_pairs=2))
        base['train']['epochs'] = min(base['train']['epochs'], 3)
    elif preset == 'grid_small':
        for L in [256,512]:
            for mid in [0,1]:
                for ms in [0.5]:
                    for dq in [6,8]:
                        for lw in [0.2,0.3]:
                            grids.append(dict(length=L, n_pairs=2, mem_into_deq=bool(mid), mem_scale=ms, deq=dq, lam_write=lw))
    elif preset == 'grid_full':
        for L in [256,512,1024]:
            for mid in [0,1]:
                for ms in [0.3,0.5,0.7,1.0]:
                    for dq in [6,8,10]:
                        for lw in [0.2,0.3]:
                            grids.append(dict(length=L, n_pairs=2, mem_into_deq=bool(mid), mem_scale=ms, deq=dq, lam_write=lw))
    else:
        # Stable baseline defaults
        for L in [256,512,1024]: grids.append(dict(length=L, n_pairs=2))
        grids.append(dict(length=512, n_pairs=2, mem_into_deq=True, mem_scale=0.5))

    # run each config
    for i, g in enumerate(grids):
        cfg = json.loads(json.dumps(base))  # deep copy
        cfg['seed'] = int(args.seed or 0)
        cfg['data']['length'] = int(g.get('length', cfg['data']['length']))
        cfg['data']['n_pairs'] = int(g.get('n_pairs', cfg['data']['n_pairs']))
        if 'deq' in g: cfg['emma']['deq_max_iter'] = int(g['deq'])
        if 'mem_into_deq' in g: cfg['emma']['mem_into_deq'] = bool(g['mem_into_deq'])
        if 'mem_scale' in g: cfg['emma']['mem_scale'] = float(g['mem_scale'])
        if 'lam_write' in g: cfg['loss']['lambda_write_cos'] = float(g['lam_write'])

        L = cfg['data']['length']; npairs = cfg['data']['n_pairs']
        mid = 1 if cfg['emma']['mem_into_deq'] else 0
        ms  = cfg['emma']['mem_scale']
        dq  = cfg['emma']['deq_max_iter']
        run_name = f"{preset}_L{L}_np{npairs}_mid{mid}_ms{ms}_dq{dq}_seed{cfg['seed']}"
        cfg_path = cfg_dir / f"{run_name}.yaml"
        with cfg_path.open('w') as f:
            import yaml
            yaml.safe_dump(cfg, f, sort_keys=False)

        logfile = runs_dir / f"{run_name}.log"
        metrics_csv = runs_dir / f"{run_name}_per_epoch.csv"
        cmd = [sys.executable, "-u", "-m", "src.train",
               "--config", str(cfg_path), "--model", "emma_liquid", "--device", "cuda",
               "--logfile", str(logfile), "--save-config", str(cfg_path), "--metrics-out", str(metrics_csv)]
        env = os.environ.copy()
        env['PYTHONUNBUFFERED'] = '1'
        # ensure both /content/emma and repo path in PYTHONPATH
        out_root = str(outdir)
        repo_path = str(outdir / 'emma_starter_v0_1')
        pypath = env.get('PYTHONPATH', '')
        for p in [out_root, repo_path]:
            if p not in pypath:
                pypath = f"{p}:{pypath}" if pypath else p
        env['PYTHONPATH'] = pypath

        t0 = time.perf_counter()
        status = 'ok'
        exc = None
        try:
            print("[train] run:", ' '.join(cmd))
            subprocess.run(cmd, env=env, check=True)
        except subprocess.CalledProcessError as e:
            status = 'failed'; exc = str(e)
            print(f"[train] failed: {e}")
        except KeyboardInterrupt as e:
            status = 'failed'; exc = 'KeyboardInterrupt'
            print('[train] interrupted by user (KeyboardInterrupt)')
        except Exception as e:
            status = 'failed'; exc = f'{type(e).__name__}: {e}'
            print(f"[train] exception: {exc}")
        wall = time.perf_counter() - t0

        # parse metrics from log
        best_val = best_post = final_loss = avg_fp = float('nan')
        read_cos_last = write_cos_last = logit_scale_last = float('nan')
        try:
            if logfile.exists():
                for line in logfile.read_text(encoding='utf-8', errors='ignore').splitlines():
                    line = line.strip()
                    if line.startswith('METRIC '):
                        try:
                            k, v = line.split('METRIC ', 1)[1].split('=')
                            v = float(v)
                            if k == 'best_val_acc': best_val = v
                            elif k == 'best_val_acc_postwarm': best_post = v
                            elif k == 'final_val_loss': final_loss = v
                            elif k == 'avg_fp_iters': avg_fp = v
                            elif k == 'walltime_sec': wall = float(v)
                        except Exception:
                            pass
                    elif 'avg_read_cos=' in line or 'avg_write_cos=' in line:
                        # parse "avg_write_cos=X avg_read_cos=Y avg_fp_iters=Z" or similar
                        try:
                            parts = line.replace(',', ' ').split()
                            for p in parts:
                                if p.startswith('avg_read_cos='): read_cos_last = float(p.split('=')[1])
                                elif p.startswith('avg_write_cos='): write_cos_last = float(p.split('=')[1])
                                elif p.startswith('logit_scale='): logit_scale_last = float(p.split('=')[1])
                        except Exception:
                            pass
        except Exception:
            pass

        # throughput estimate (tokens/s per epoch)
        try:
            toks_per_epoch = int(cfg['data']['train_size']) * int(cfg['data']['length'])
            epochs = int(cfg['train']['epochs'])
            eff_toks_per_s = (toks_per_epoch * epochs) / max(1e-6, wall)
        except Exception:
            eff_toks_per_s = float('nan')

        row = dict(
            timestamp=time.strftime('%Y-%m-%d %H:%M:%S'), run_name=run_name,
            length=L, n_pairs=npairs, epochs=cfg['train']['epochs'], batch=cfg['train']['batch_size'],
            lr=cfg['train']['lr'], wd=cfg['train']['wd'], lam_pred=cfg['loss']['lambda_pred_ce'],
            lam_write=cfg['loss']['lambda_write_cos'], lam_nce=cfg['loss']['lambda_write_nce'],
            warm_start=cfg['emma']['warm_start_epochs'], mix_min=cfg['emma']['oracle_mix_min'],
            deq=cfg['emma']['deq_max_iter'], mem_into_deq=int(cfg['emma']['mem_into_deq']), mem_scale=cfg['emma']['mem_scale'],
            best_val_acc=(f"{best_val:.6f}" if best_val==best_val else 'nan'),
            best_val_acc_postwarm=(f"{best_post:.6f}" if best_post==best_post else 'nan'),
            final_val_loss=(f"{final_loss:.6f}" if final_loss==final_loss else 'nan'),
            avg_fp_iters=(f"{avg_fp:.6f}" if avg_fp==avg_fp else 'nan'),
            walltime_sec=(f"{wall:.3f}" if wall==wall else 'nan'),
            avg_read_cos_last=(f"{read_cos_last:.6f}" if read_cos_last==read_cos_last else 'nan'),
            avg_write_cos_last=(f"{write_cos_last:.6f}" if write_cos_last==write_cos_last else 'nan'),
            logit_scale_last=(f"{logit_scale_last:.6f}" if logit_scale_last==logit_scale_last else 'nan'),
            device='cuda', gpu_name=(gpu['name'] if gpu else 'unknown'),
            flag=('unstable' if (best_post==best_post and best_post < 0.6) else '')
        )
        if status != 'ok':
            row['flag'] = (row.get('flag','') + ('; ' if row.get('flag') else '') + f'status={status} {exc or ""}').strip()
        header = list(row.keys())
        write_csv_append(results_csv, header, row)
        print(f"[train] logged {run_name}  tokens/s≈{eff_toks_per_s:.1f}")


# == [SUMMARY] == leaderboard + shortlist
def run_summary(args, outdir: Path):
    src = outdir / 'results' / 'experiment_log.csv'
    if not src.exists():
        print("[summary] no experiment_log.csv yet at", src)
        return
    rows = []
    with src.open('r') as f:
        for r in csv.DictReader(f):
            rows.append(r)
    # filters
    def tofloat(x, default=float('nan')):
        try: return float(x)
        except Exception: return default
    filtered = [r for r in rows if (tofloat(r.get('best_val_acc_postwarm','nan')) >= 0.70)
                and (tofloat(r.get('walltime_sec','nan')) <= 3600.0)
                and (tofloat(r.get('avg_fp_iters','nan')) <= (float(r.get('deq', '0')) + 1.0))]
    # rank: best_val_acc_postwarm desc, tie-break final_val_loss asc, then walltime asc
    filtered.sort(key=lambda r: (-tofloat(r.get('best_val_acc_postwarm','nan')), tofloat(r.get('final_val_loss','nan')), tofloat(r.get('walltime_sec','nan'))))
    out = outdir / 'results' / 'leaderboard.csv'
    if filtered:
        header = list(filtered[0].keys())
        with out.open('w', newline='') as f:
            w = csv.DictWriter(f, fieldnames=header)
            w.writeheader(); w.writerows(filtered)
        print("[summary] wrote", out)
        # shortlist: two commands to rerun best configs
        best_false = next((r for r in filtered if r.get('mem_into_deq','0') in ('0', 0, 'False', 'false')), None)
        best_true  = next((r for r in filtered if r.get('mem_into_deq','0') in ('1', 1, 'True', 'true')), None)
        def cmd_for(r):
            name = r['run_name']
            cfg = outdir / 'runs' / 'configs' / f"{name}.yaml"
            return f"python -u -m src.train --config {cfg} --model emma_liquid --device cuda --logfile runs/{name}.log --save-config runs/configs/{name}.yaml"
        print("[shortlist]")
        if best_false:
            print(cmd_for(best_false))
        if best_true:
            print(cmd_for(best_true))
        if not (best_false or best_true):
            print("no stable candidates yet")
    else:
        print("[summary] no rows passed stability filters; writing empty leaderboard")
        with out.open('w', newline='') as f:
            f.write('')


# == [DRIVE] == optional sync to Google Drive
def run_drive(args, outdir: Path):
    mount_at = Path(args.mount or '/content/drive/MyDrive/EMMA_runs')
    try:
        from google.colab import drive as _drive
        _drive.mount('/content/drive')
    except Exception as e:
        print('[drive] failed to mount Google Drive:', e)
        return
    dest = mount_at
    dest.mkdir(parents=True, exist_ok=True)
    # mirror copy results and runs
    def _rsync(src: Path, dst: Path):
        import shutil
        dst.mkdir(parents=True, exist_ok=True)
        for root, dirs, files in os.walk(src):
            rel = os.path.relpath(root, src)
            for d in dirs:
                (dst / rel / d).mkdir(parents=True, exist_ok=True)
            for fn in files:
                s = Path(root) / fn
                t = dst / rel / fn
                t.parent.mkdir(parents=True, exist_ok=True)
                try:
                    shutil.copy2(s, t)
                except Exception as e:
                    print('[drive] copy failed for', s, '->', t, ':', e)
    _rsync(outdir / 'results', dest / 'results')
    _rsync(outdir / 'runs', dest / 'runs')
    print('[drive] mirrored to', dest)


def print_howto(outdir: Path):
    msg = f'''
# 1) Switch Runtime → GPU
# 2) Upload EMMA_Colab_AllInOne.py
!python EMMA_Colab_AllInOne.py --prep
!python EMMA_Colab_AllInOne.py --mode probes --lengths 256,512,1024 --n_pairs 1,2 --deq_iters 6,8 --mem_scales 0.5
!python EMMA_Colab_AllInOne.py --mode train --preset long512 --epochs 4
!python EMMA_Colab_AllInOne.py --mode summary
'''
    print(msg.strip())


def main():
    parser = argparse.ArgumentParser(description='EMMA All-In-One Colab Runner')
    parser.add_argument('--prep', action='store_true', help='Install minimal deps, extract repo, sanity import')
    parser.add_argument('--mode', type=str, default=None, choices=['probes','train','summary','drive'])
    parser.add_argument('--outdir', type=str, default='/content/emma')
    parser.add_argument('--seed', type=int, default=0)
    parser.add_argument('--max_concurrent', type=int, default=1)
    # probes args
    parser.add_argument('--lengths', type=str, default='256,512,1024,2048')
    parser.add_argument('--n_pairs', type=str, default='1,2,4')
    parser.add_argument('--deq_iters', type=str, default='4,6,8,10,12')
    parser.add_argument('--mem_scales', type=str, default='0.3,0.5,0.7,1.0')
    parser.add_argument('--batch', type=int, default=128)
    # train args
    parser.add_argument('--preset', type=str, default='long512', choices=['long256','long512','long1024','grid_small','grid_full'])
    parser.add_argument('--epochs', type=int, default=4)
    parser.add_argument('--early_stop_patience', type=int, default=1)
    parser.add_argument('--bsz', type=int, default=32)
    parser.add_argument('--lr', type=float, default=3e-3)
    parser.add_argument('--wd', type=float, default=0.01)
    parser.add_argument('--lam_pred', type=float, default=0.3)
    parser.add_argument('--lam_write', type=float, default=0.2)
    parser.add_argument('--lam_nce', type=float, default=0.3)
    parser.add_argument('--mix_min', type=float, default=0.3)
    parser.add_argument('--warm_start', type=int, default=2)
    parser.add_argument('--deq', type=int, default=8)
    parser.add_argument('--mem_into_deq', type=int, choices=[0,1], default=0)
    parser.add_argument('--mem_scale', type=float, default=0.5)
    # data size overrides for quick smoke runs
    parser.add_argument('--train_size', type=int, default=None)
    parser.add_argument('--val_size', type=int, default=None)
    parser.add_argument('--num_workers', type=int, default=0)
    # drive
    parser.add_argument('--mount', type=str, default='/content/drive/MyDrive/EMMA_runs')

    args = parser.parse_args()

    # Preflight env flags
    os.environ.setdefault("TORCHDYNAMO_CAPTURE_SCALAR_OUTPUTS", "1")
    try:
        import torch
        torch.set_float32_matmul_precision("medium")
        try:
            torch.backends.cudnn.benchmark = True
        except Exception:
            pass
    except Exception:
        pass

    outdir = Path(args.outdir)
    # --prep: minimal deps, extract, sanity import
    if args.prep:
        colab_prep_install(minimal=True)
        repo_root = extract_repo(outdir)
        print('[prep] extracted to', repo_root)
        # sanity import
        try:
            import src.train  # noqa
            print('[prep] import ok: src.train')
        except Exception as e:
            print('[prep] import failed:', e)
        info = gpu_info()
        if info:
            print(f"[gpu] {info['name']} total={info['total_mb']}MB free={info.get('free_mb','?')}MB")
        else:
            print('[gpu] no CUDA detected (ok for prep).')
        print_howto(outdir)
        return

    # for operational modes, ensure extraction and runtime paths
    repo_root = extract_repo(outdir)
    # Mode dispatch
    if args.mode == 'probes':
        run_probes(args, outdir)
    elif args.mode == 'train':
        run_train(args, outdir)
    elif args.mode == 'summary':
        run_summary(args, outdir)
    elif args.mode == 'drive':
        run_drive(args, outdir)
    else:
        print('Use --prep or --mode {probes,train,summary,drive}. Try --help for options.')


if __name__ == '__main__':
    main()
